import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbar-logo">
                <img src="logo.png" alt="benefit logo" />
            </div>
            <Link to="/"><div class="nav-link">Home</div></Link>
        </div>
    )
}

export default Navbar;
